import React from 'react';
import { Route, Routes } from 'react-router-dom';
import Selection from '../components/selection/Selection';

const Homepage: React.FC = () => {
  return (
    <Routes>
      <Route path="/" element={<Selection />} />
    </Routes>
  );
};

export default Homepage;
